  const [wines, setWines] = useState([]);
  const getWines = () => {
    fetch("http://localhost:4000/getWines")
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
        setWines([json]);
      });
  };



  
  return (
    <div>
      Wines
      
    </div>
  );
};

